    public static double[] neuro_tansig(double[][] m_in, double[] b_in, double[] din){
        int Ldin = din.length;
        int Lbin = b_in.length;
        int m = m_in.length;
        int n = m_in[0].length;
        double[] d_out = new double[m];
        double[][] d_out2 = new double[m][1];
        GIS_Log.d(TAG,"m="+m+",n="+n+", Lbin="+Lbin);
        if (n==Ldin && m==Lbin){
//			d_out2=m_in*din
            RealMatrix m_inR = new Array2DRowRealMatrix(m_in);
            RealMatrix dinR = new Array2DRowRealMatrix(din);
            d_out2 = m_inR.multiply(dinR).getData();
        }else{
            Arrays.fill(d_out, 0);
        }
        for (int i=0;i<m;i++){
	  		d_out[i] = tansig2(d_out2[i][0]+b_in[i]);
        }
        return d_out;
    }

    public static double neuro_lin(double[][] m_in, double b_in, double[] din){
        int Ldin = din.length;
        int Lbin = 1;
        int m = m_in.length;
        int n = m_in[0].length;
        double d_out;
        double[][] d_out2 = new double[m][1];
        if (n==Ldin && m==Lbin){
            RealMatrix m_inR = new Array2DRowRealMatrix(m_in);
            RealMatrix dinR = new Array2DRowRealMatrix(din);
            d_out2 = m_inR.multiply(dinR).getData();
        }else{
            d_out = 0;
        }
        d_out = d_out2[0][0]+b_in;

        return d_out;
    }

    public static double tansig2(double din){
        return (2/(1+Math.exp(-2*din)))-1;
    }

